module adder_16(output [15:0] sum,
                      output cout,
                      input [15:0] in1, in2,
                      input cin); 

  wire [15:0] sum;
  wire cout;
  wire [15:0] in1;
  wire [15:0] in2;
  wire cin;

  wire [15:0] sum_temp;
  wire cout_temp;
  wire [15:0] in1_temp;
  wire [15:0] in2_temp;
  wire cin_temp;

  assign sum_temp = in1 + in2;
  assign cout_temp = cin + (in1 & in2);

  assign sum = sum_temp[15:0];
  assign cout = cout_temp;

  assign in1_temp = {1'b0, in1[15:1]};
  assign in2_temp = {1'b0, in2[15:1]};
  assign cin_temp = cin;

  always @(in1_temp or in2_temp or cin_temp)
  begin
    if (cin_temp == 1'b0)
    begin
      sum = sum_temp[15:0];
      cout = cout_temp;
    end
    else
    begin
      sum = 16'b0;
      cout = 1'b0;
    end
  end

endmodule

